  false,\n\t\"url\": null,\n\t\"notes\": \"The Phragmites control effort of 1993 was
  initiated as part of a cooperative program with the state of Virginia's Division
  of Natural Heritage, called the \"Southern Watershed Common Reedgrass Control Project\".
  They agreed to treat approximately 100 acres of Refuge property with dense Phragmites
  concentrations. These treatment areas consist of sites in Tracts 126 (829 Sandbridge
  Road), 104 (Rigg's Tract), and in A and B pools on the Refuge. In late August, Ken
  Clark of the Division of Natural Heritage and the Refuge finalized the sites to
  be treated. On September 7, two line transects were established; one through a treatment
  site and the other through an untreated (control) site.\",\n\t\"license_title\":
